import './App.css';
import React from 'react';
import Star from './starWars/Star';
import AlignItemsList from "./starWars/List"
const styles = {
    paperContainer: {
        height: 136,
        backgroundImage: `url(${"https://64.media.tumblr.com/d96d6d4360f27da5c47221e68cdff36f/tumblr_olucp2SNGx1vsjcxvo1_r1_640.gifv"})`,
        backgroundRepeat  : 'no-repeat',
       backgroundPosition: 'center',
    }
};
function App() {
  return (
    <div className="App">
      <header style={styles.paperContainer}>
       <h1 >Star Wars</h1>
      </header>


      <Star/>
   <AlignItemsList/>


    </div>
  );
}

export default App;
